import { Drawer } from "rsuite";

const NewCode = ({show, toggleDrawer}) => {
    const NewCodeStyle={
        width: "30%",
        marginLeft: "5rem"
    }
    return(
        <>
            <Drawer show={show} onHide={toggleDrawer} placement="bottom" style={NewCodeStyle}>
                <Drawer.Header>Add Code</Drawer.Header>
                <Drawer.Body>

                </Drawer.Body>
            </Drawer>
        </>
    )
}

export default NewCode;
